import { AppProps } from 'next/app';
import Layout from '../components/Layouts';
import '../styles/home.scss';
import '../styles/admin/styles.scss';

function App({ Component, pageProps }: AppProps) {
  return (
        <Layout>
          <Component {...pageProps} />
        </Layout>
  )
}

export default App;
